import React, { Component } from "react";
import PostData from "./bio.json";
class App extends Component {
  render() {
    return (
      <>
        <center>
          <div>
            {PostData.map((postDetail, index) => {
              return <p>{postDetail.title}</p>;
            })}
            {PostData[0].title}
          </div>
        </center>
      </>
    );
  }
}

export default App;
